import React from 'react';
import CountUp from 'react-countup';
import { Box, Grid, Typography, makeStyles } from '@material-ui/core';
import { SectionHeading } from '../Component';
import { ProjectCountData } from './ProjectCountData';

const useStyles = makeStyles(theme => ({
    margin: { margin: "0 auto" }
}))

const ProjectCount = () => {
    const classes = useStyles();
    return (
        <>
            <Box className="container-fluid" my={5}>
                <Grid container>
                    <Grid item lg={10} md={11} className={classes.margin}>
                        <Box>
                            <SectionHeading head="More than 1500 websites are designed" />
                            <Box>
                                <Grid container>
                                    {ProjectCountData.map((item, index) => {
                                        return (<>
                                            <Grid lg={3} xs={6}>
                                                <Box>
                                                    <Typography><CountUp start={0} end={item.projectCount} duration={2} /></Typography>
                                                    <Typography>{item.project}</Typography>
                                                </Box>
                                            </Grid>
                                        </>)
                                    })}
                                </Grid>
                            </Box>
                        </Box>
                    </Grid>
                </Grid>
            </Box>
        </>
    )
}

export default ProjectCount
